import "./Contact.css";
import "../App.css";

function Contact() {
  return (
    <>
      <div className="container">
        <h1 className="page-title">Contact</h1>
        <hr></hr>
        <h1>How will I receive my reading?</h1>
        <p>
          H<br></br>
          Readings will be sent through Etsy messages. Email also works if
          requested.
        </p>
      </div>
    </>
  );
}

export default Contact;
